import React from "react";
import Product from "./product.js";
import { render } from "@testing-library/react";

export default class Body extends React.Component {
  componentDidMount() {
    fetch("./data/prodet.json")
      .then((res) => res.json())
      .then((data) => (this.state = data));
  }

  render() {
    const productComponents = this.state.map((card) => {
      <Product key={card.id} name={card.name} details={card.det} />;
    });
    return <div>{}</div>;
  }
}
